import "./Navigation.scss";
const Navigation = () => {
  return (
    <div className="navigation">
      <div className="navigation__left">
        <a href="#" className="navigation__link">
          home nav
        </a>
      </div>
      <div className="navigation__right">
        <a href="#" className="navigation__link">
          navigation 1
        </a>
        <a href="#" className="navigation__link">
          navigation 2
        </a>
        <a href="#" className="navigation__link">
          navigation 3
        </a>
      </div>
    </div>
  );
};
export default Navigation;
